import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faQuestion } from '@fortawesome/free-solid-svg-icons';

const HelpButton = () => {
  return (
    <div className='bg-black'>
        <FontAwesomeIcon icon={faQuestion} className='text-white text-3x1'/>
        {/* <img src="client\public\questionmark.png" alt="" className='bg-white'/> */}
    </div>
  )
}

